# your_script.py\nimport random\nimport pickle\nfrom django.core.files.base import ContentFile\nfrom your_app.models import Data  # Replace 'your_app' with the name of your Django app\n\n# Generate some data\nsomedata = [random.random() for i in range(10000)]\n\n# Pickle the data\npickled_data = pickle.dumps(somedata)\n\n# Create a ContentFile from the pickled data\ncontent = ContentFile(pickled_data)\n\n# Create a new Data instance\ndata_entry = Data(label="somedata")\n\n# Save the file\nfilename = "somedata.pkl"  # You can choose any filename\ndata_entry.file.save(filename, content)\n\n# Save the model instance to the database\ndata_entry.save()